// Get the cover of an album as a base64 encoded JSON
ScrapeEngine.prototype.getCover = function (album, artist, callback) {
  var coverData = (album === 'Ramen Music #04')
    ? ''
    : ''
    callback(null, coverData)
}

// Get a list of object, which contains similar title information and the url
ScrapeEngine.prototype.getSimilarTitle = function (title, album, artist, genre, callback) {
  // Cleanup request
  title = title === '' || !title ? null : title
  album = album === '' || !album ? null : album
  artist = artist === '' || !artist ? null : artist
  genre = genre === '' || !genre ? null : genre
  console.log('Getting similar title for...', {title: title, album: album, artist: artist, genre: genre})

  // Get similar title by genre
  if (genre) {
    switch (genre) {
      case 'Hip-Hop':
        callback(null, this.hipHop)
        break
      case 'Rock':
        callback(null, this.rock)
        break
      case 'Alternative':
        callback(null, this.alternative)
        break
      case 'Jazz':
        callback(null, this.jazz)
        break
      case 'Folk':
        callback(null, this.folk)
        break
      case 'Pop-Folk':
        callback(null, this.popFolk)
        break
      case 'Pop':
        callback(null, this.pop)
        break
      case 'Synthpop':
        callback(null, this.synthpop)
        break
      case 'Indie':
        callback(null, this.indie)
        break
      case 'Ambient':
        callback(null, this.ambient)
        break
      default:
        break
    }
  }

  return callback(null, [])
}
